import React from 'react';
import { AppBar, Toolbar, Typography, Grid, Card, CardMedia, CardContent, Button } from '@mui/material';

const App = () => {
  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          {/* Add your navigation items here */}
          <Typography variant="h6">Daniel Destefanis</Typography>
          <Button color="inherit">Menu</Button>
        </Toolbar>
      </AppBar>
      <Grid container spacing={2} style={{ padding: '20px' }}>
        {/* Iterate over your projects and create a grid item for each one */}
        {projects.map(project => (
          <Grid item xs={12} sm={6} md={4} key={project.id}>
            <Card>
              <CardMedia
                component="img"
                height="140"
                image={project.imageUrl}
                alt={project.title}
              />
              <CardContent>
                {/* Project information goes here */}
                <Typography gutterBottom variant="h5" component="div">
                  {project.title}
                </Typography>
                {/* ... */}
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default App;
